import React from 'react';
import '../header.css';
import logo from '../images/logo.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAnglesDown, faUser, faCog } from '@fortawesome/free-solid-svg-icons'; // Import icons


const Header = function() {
    return( 
        <header className='header'>
            <div className='header-logo'>
                <img alt='logo' src={logo} style={{ height: '60px', width: 'auto' }}/>
                <h1 className='header-tagline'>Digital Lab Assistant</h1>
            </div>
            <nav className='header-nav'>
                <ul>
                <li><a href='#'>Home</a></li>
                <li><a href='#'>Contact Us</a></li>
                </ul>
            </nav>
            <div className="header__user">
        <img src="/path/to/user-avatar.png" alt="User Avatar" className="header__user-avatar" />
        <span className="header__user-name">Username</span>
      </div>
        </header>
    );
}

export default Header;
